// src/pages/dashboard.jsx
import React from "react";
import { RiMoneyDollarCircleLine, RiBankLine, RiFileListLine, RiShieldCheckLine, RiCardLine, RiHandCoinLine, RiTrainLine, RiShoppingCartLine } from "react-icons/ri";

export default function Dashboard() {
  return (
    <div className="min-h-screen bg-gray-50 p-4">
      
      {/* Search & Chatbot */}
      <div className="flex items-center justify-between mb-4">
        <input
          type="text"
          placeholder="Search..."
          className="flex-1 p-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-blue-500 focus:outline-none"
        />
        <button className="ml-2 bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded-lg">
          Chatbot
        </button>
      </div>

      {/* Main service grid */}
      <div className="grid grid-cols-4 gap-4 mb-4">
        <Card icon={<RiBankLine size={24} />} title="Accounts" />
        <Card icon={<RiMoneyDollarCircleLine size={24} />} title="Deposits" />
        <Card icon={<RiHandCoinLine size={24} />} title="Loans" />
        <Card icon={<RiFileListLine size={24} />} title="Investments" />
        <Card icon={<RiShieldCheckLine size={24} />} title="Insurance" />
        <Card icon={<RiCardLine size={24} />} title="Cards" />
        <Card icon={<RiHandCoinLine size={24} />} title="YONO Pay" />
        <Card icon={<RiMoneyDollarCircleLine size={24} />} title="YONO Cash" />
      </div>

      {/* Banner section */}
      <div className="bg-white p-4 rounded-lg shadow mb-4">
        <p className="text-gray-700 text-sm">
          ðŸŽ‰ Congrats! You are eligible for Life Cover upto <b>â‚¹40,00,000</b>. Get Policy instantly without Medical test or Documentation. 
          <span className="text-blue-600 font-semibold cursor-pointer"> Tap here to Avail Now!</span>
        </p>
      </div>

      {/* Quick actions */}
      <div className="grid grid-cols-4 gap-4 mb-4">
        <Card icon={<RiShoppingCartLine size={24} />} title="Shop & Order" />
        <Card icon={<RiHandCoinLine size={24} />} title="Bill Payment" />
        <Card icon={<RiFileListLine size={24} />} title="Mobility" />
        <Card icon={<RiTrainLine size={24} />} title="Train Ticket" />
      </div>

      {/* Footer info */}
      <div className="bg-white p-4 rounded-lg shadow text-center text-sm text-gray-600">
        &copy; 2025 HDFC Bank. All rights reserved.
      </div>
    </div>
  );
}

// Reusable Card Component
const Card = ({ icon, title }) => (
  <div className="bg-white flex flex-col items-center justify-center p-3 rounded-lg shadow hover:shadow-lg transition cursor-pointer">
    {icon}
    <span className="text-sm mt-2">{title}</span>
  </div>
);
